webpackJsonp([47530425650971],{6949:function(e,t){e.exports={data:{post:{html:'<p>Yesterday\'s edition of the <a href="http://www.fr-aktuell.de/">Frankfurter Rundschau</a> newspaper was <a href="http://www.spiegel.de/kultur/gesellschaft/0,1518,311492,00.html" title="Frankfurter Rundschau: Die Un-Veröffentlichte - Kultur - SPIEGEL ONLINE">recalled from the newstands</a> because two letters were missing from the masthead. The sub-title read "Dependent Newspaper" rather than "Independent Newspaper".</p>\n<p>The funny thing is that the independence of the FR has been <a title="Reaktionen auf SPD-Einstieg: Zweifel an Unabhängigkeit der Frankfurter Rundschau - FAZ.NET" href="http://www.faz.net/s/RubFAE83B7DDEFD4F2882ED5B3C15AC43E2/Doc~E24735D91E279479BB43D51079E83604E~ATpl~Ecommon~Scontent.html">called into question</a> since being taken over by the <a href="http://www.ddvg.de/">ddvg</a>, the media holding of the <a href="http://www.spd.de/">SPD</a> (yes, the political party) which owns a <a href="http://www.ddvg.de/wirberuns/unserebeteiligungen">number of German regional papers.</a></p>',fields:{title:"Two Letters Gone",date:"04 Aug 2004",url:"https://papascott.de/2004-08-04-two-letters-gone/"}}},pathContext:{slug:"/2004-08-04-two-letters-gone/",prev:{fields:{title:"Quit whining, Germany!",date:"04 Aug 2004",slug:"/2004-08-04-quit-whining-germany/"}},next:{fields:{title:"1st Day Kindergarten",date:"05 Aug 2004",slug:"/2004-08-05-1st-day-kindergarten/"}}}}}});
